import React, { useState } from 'react';
import Slider from 'react-slick';
import './Gallery.css';

const Gallery = () => {
  // Set up initial category (default to 'all')
  const [selectedCategory, setSelectedCategory] = useState('all');
  const [activeVideo, setActiveVideo] = useState(null); // To handle playing videos

  // Sample data for images and videos
  const galleryData = {
    venue: [
      { src: 'venue1.jpg', type: 'image', text: 'Elegant Wedding Venue' },
      { src: 'venue2.jpg', type: 'image', text: 'Grand Wedding Venue' },
      { src: 'venue3.jpg', type: 'image', text: 'Beautiful Open Venue' },
      { src: 'venue4.jpg', type: 'image', text: 'Traditional Wedding Venue' },
      { src: 'venue5.jpg', type: 'image', text: 'Luxury Wedding Venue' },
      { src: 'venue6.jpg', type: 'image', text: 'Rooftop Wedding Venue' },
    ],
    decor: [
      { src: 'decor1.jpg', type: 'image', text: 'Traditional Indian Decor' },
      { src: 'decor2.jpg', type: 'image', text: 'Luxury Floral Setup' },
      { src: 'decor3.jpg', type: 'image', text: 'Sculptured Wedding Setup' },
      { src: 'decor4.jpg', type: 'image', text: 'Elegant Stage Design' },
      { src: 'decor5.jpg', type: 'image', text: 'Vintage Wedding Decor' },
      { src: 'decor6.jpg', type: 'image', text: 'Contemporary Wedding Design' },
    ],
    food: [
      { src: 'food1.jpg', type: 'image', text: 'Delicious Wedding Food' },
      { src: 'food2.jpg', type: 'image', text: 'Exquisite Indian Cuisine' },
      { src: 'food3.jpg', type: 'image', text: 'Gourmet Wedding Dishes' },
      { src: 'food4.mp4', type: 'video', text: 'Delicious Wedding Food (Video)' },
      { src: 'food5.mp4', type: 'video', text: 'Exquisite Wedding Dish Preparation (Video)' },
    ],
    // More categories like photography, stage setups, etc.
  };

  // Filter data based on selected category
  const filteredData = selectedCategory === 'all'
    ? [...galleryData.venue, ...galleryData.decor, ...galleryData.food]  // Add more categories
    : galleryData[selectedCategory];

  // Carousel settings
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
    arrows: true, // Show next/prev buttons
  };

  const handleVideoClick = (src) => {
    setActiveVideo(src); // Set the video source to play
  };

  return (
    <div className="gallery-container">
      <div className="gallery-header">
        <h2>Our Masterpieces</h2>
        <p>Explore the stunning wedding celebrations we've crafted.</p>
      </div>

      {/* Gallery Categories */}
      <div className="gallery-categories">
        <button className="category-btn" onClick={() => setSelectedCategory('venue')}>Venue</button>
        <button className="category-btn" onClick={() => setSelectedCategory('decor')}>Decor</button>
        <button className="category-btn" onClick={() => setSelectedCategory('food')}>Food</button>
        <button className="category-btn" onClick={() => setSelectedCategory('all')}>All</button>
      </div>

      {/* Image or Video Carousel */}
      <Slider {...settings}>
        {filteredData.map((item, index) => (
          <div className="gallery-item" key={index}>
            {item.type === 'image' ? (
              <img src={item.src} alt={item.text} className="gallery-img" />
            ) : (
              // Display video thumbnail and play button for videos
              <div className="video-container" onClick={() => handleVideoClick(item.src)}>
                <img src="play-icon.png" alt="Play" className="play-icon" />
                <img src={item.src} alt={item.text} className="gallery-img" />
              </div>
            )}
            <div className="overlay">
              <div className="text">{item.text}</div>
            </div>
          </div>
        ))}
      </Slider>

      {/* Play Video Modal */}
      {activeVideo && (
        <div className="video-modal" onClick={() => setActiveVideo(null)}>
          <div className="video-modal-content">
            <video controls autoPlay>
              <source src={activeVideo} type="video/mp4" />
              Your browser does not support the video tag.
            </video>
          </div>
        </div>
      )}
    </div>
  );
};

export default Gallery;
